import React,{useState,useEffect} from "react";
import '../styles/Formm.css';


const getLocation=()=>{
  navigator.geolocation.getCurrentPosition((position)=>{
    console.log(position);
    var {latitude}=position.coords;
    var {longitude}=position.coords;
    console.log(latitude,longitude);
  },()=>{
    alert("could not get your postion");
  })
}


const  Myform=()=>{
    const [user,setUser]=useState({
      name:"",email:"",aspect:"",phone:"",location:"",lat:"",longi:"",ownership:"",purpose:"",specie:"",spacing:"",survivalRate:"",suggestions:"",date:"",pic:"",other:""
    });
    
    const {name,email,aspect,phone,location,lat,longi,ownership,purpose,specie,spacing,survivalRate,suggestions,date,pic,other}=user;
    
    let name1,value;
    const handleInputs=(e)=>{
      console.log(e);
      name1=e.target.name1;
      value=e.target.value;
      setUser({...user,[name1]:value});
    }
    const onSubmit=async(e)=>{
      e.preventDefault();
      const newUser={
        name1:name1,

      }
    }

    return (
        <div className="Form">
          <div className="testbox">
          <form onSubmit={(e)=>onSubmit(e)}>
            <div className="banner">
              <h1 className='header'>Performa for Agroforestry and Farm Forestry</h1>
            </div>
            <div className="item">
              <p>Location</p>
              <div className="name1-item">
                <input className="input" type="text" name1="location"
                value={user.location}
                onChange={(e)=>handleInputs(e)}
                
                placeholder="Location" required/>
              </div>
            </div>
            <div className="item">
                <p>Name:</p>
                <div className="name1-item">
                  <input type="text" className="input" name1="name1"
                  value={user.pname}
                  onChange={(e)=>handleInputs(e)}
                  
                  placeholder="Enter name1" required/>
              </div>
            </div>
            <div className="item">
              <p>Email</p>
              <input type="email" className="input" name1="email" 
              value={user.email}
              onChange={(e)=>handleInputs(e)}
              
              placeholder='email' required/>
            </div>
            <div className="item">
              <p>Phone</p>
              <input type="text" name1="phone" 
              value={user.phone}
              onChange={(e)=>handleInputs(e)}
              
              placeholder="92 333000000" required/>
            </div>
            <div className="item">
              <p>GPS Coordinates:</p>
              <button onClick={getLocation()}>Location</button>
            </div>
            <div className="item">
              <p>Aspect:</p>
              <input type="text" className="input" name1="aspect" 
              value={user.aspect}
              onChange={(e)=>handleInputs(e)}
              
              placeholder='Aspect' required/>
            </div>
            <div className="question">
              <p>OwnerShip:</p>
              <div className="question-answer">
                <div>
                  <input className="radio" type="radio" name1="ownerShip"
                  value={user.ownership}
                  onChange={(e)=>handleInputs(e)}
                  
                  required/>
                  <label htmlFor="radio" className="radio1"><span>Community</span></label>
                </div>
                <div>
                  <input type="radio" name1="ownerShip1"
                  value={user.ownership}
                  onChange={(e)=>handleInputs(e)}
                  
                  required/>
                  <label htmlFor="radio" className="radio2"><span>Individual</span></label>
                </div>
              </div>
            </div>
            <div className="question">
              <p>Purpose of AF/FF:</p>
              <div className="question-answer radioopt">
                <div>
                  <input type="radio"  name1="purpose1"
                  value={user.purpose}
                  onChange={(e)=>handleInputs(e)}
                  
                  id="radio_4" required/>
                  <label htmlFor="radio_4"  className="radio3"><span>Fuel Wood</span></label>
                </div>
                <div>
                  <input type="radio"  name1="purpose2"
                   value={user.purpose}
                   onChange={(e)=>handleInputs(e)}
                   
                  id="radio_5" required/>
                  <label htmlFor="radio_5" className="radio4"><span>Fodder</span></label>
                </div>
                <div className="timber">
                  <input type="radio" name1="purpose3"
                  value={user.purpose}
                  onChange={(e)=>handleInputs(e)}
                  
                  id="radio_6" required/>
                  <label htmlFor="radio_6" className="radio5"><span>Timber</span></label>
                </div>
                <div className="others">
                    <label ><span>Other(please specify)</span></label>
                    <input type="text" className="input1" id="radio_6" name1="other"
                     value={user.other}
                     onChange={(e)=>handleInputs(e)}
                     
                    required/>
                </div>
                <div className="item">
                    <p>Species Of Plants Provided:</p>
                    <input type="text" className="input" name1="specie" 
                    value={user.specie}
                    onChange={(e)=>handleInputs(e)}
                    
                    required/>
                </div>
                <div className="item">
                    <p>Spacing:</p>
                    <input type="text" className="input" name1="spacing" 
                    value={user.spacing}
                    onChange={(e)=>handleInputs(e)}
                    
                     required/>
                </div>
                <div className="item">
                    <p>Survival Rate:</p>
                    <input type="text" className="input" name1="survivalRate" 
                     value={user.survivalRate}
                     onChange={(e)=>handleInputs(e)}
                   
                     required/>
                </div>
                <div className="item">
                    <p>Suggestions:</p>
                    <input type="text" className="input" name1="suggestions" 
                    value={user.suggestions}
                    onChange={(e)=>handleInputs(e)}
                    
                    required/>
                </div>
              </div>
            </div>
            <div className="item1">
                <p>Date of Planting:</p>
                <input type="date"
                value={user.date}
                onChange={(e)=>handleInputs(e)}
                
                name1="date" required/>
                <i className="fas fa-calendar-alt"></i>
            </div>
            <div >
                <input  type="file" className="input"
                value={user.pic}
                onChange={(e)=>handleInputs(e)}
                
                name1="pic" />
                <i className="fas fa-calendar-alt"></i>
            </div>
            <div className="btn-block btn">
              <button type="submit" href="#">Submit</button>
            </div>
          </form>
        </div>
        </div>
      );

}
export default Myform;
